window.bookSummaryJSON = "<p>Jason and MMax found their way home and found Jason's parents alive and well. MMax and Jason were soon asked to go rescue his brother and sister. While Jason is busy trying to rescue his siblings, the evil one, Ray, rears his head and tries to wreak havoc. Can MMax protect Jason during his quest or will both perish? MMax is one smart dog with military training to succeed.</p> <p>Along the way to save his sister, Jason saves Kat from a horrible fate. She is the most stubborn, hardheaded, nice, and lovely woman he has ever met. The pint-size woman stubbornly refuses to let the evil people of the world defeat her.</p> <p>Can Jason and MMax find and save Jason's loved ones and uphold No One Left Behind, or will they be killed along the way?</p>"; 
